import Userlist from "./components/Userlist";
import Adduser from "./components/TambahUser";

function App() {
  return (
    <>
    // data user
    <BrowserRouter>
      <div className="container-fluid bg-light">
          <Userlist />
        </div>
    </BrowserRouter>
    // input user
    <BrowserRouter>
      <div className="container-fluid bg-light">
        <Adduser />
      </div>
    </BrowserRouter>
    </>
  );
}

export default App;
